import LandlordCard from "./LandlordCard"
import Heading from "../../common/Heading/Heading"
import classes from "./Landlord.module.css"
import {useState, useEffect} from "react"
import {getAllUsers} from '../../../../api/UserApi'

const Data = [
    {
      list: "50",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-1.jpg",
      address: "Liverpool, Canada",
      name: "Sargam S. Singh",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
    {
      list: "70",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-2.jpg",
      address: "Montreal, Canada",
      name: "Harijeet M. Siller",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
    {
      list: "80",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-3.jpg",
      address: "Denever, USA",
      name: "Anna K. Young",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
    {
      list: "51",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-4.jpg",
      address: "2272 Briarwood Drive",
      name: "Michael P. Grimaldo",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
    {
      list: "42",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-5.jpg",
      address: "2272 Briarwood Drive",
      name: "Michael P. Grimaldo",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
    {
      list: "38",
      cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-5.jpg",
      address: "Montreal, USA",
      name: "Adam K. Jollio",
      icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
    },
]

const Landlord = () => {
    const [data, setData] = useState([])
    
    useEffect(() => {
        getAllUsers()
        .then((data) => {
            const temp = []
            data.forEach(data => {
                temp.push({
                    name: data.username,
                    cover: data.image,
                    address: data.city + ' - ' + data.district + ' - ' + data.ward,
                    linkfb: data.linkfb,
                    linkin: data.linkin,
                    linktw: data.linktw,
                    linkli: data.linkli,
                })
            })
            setData(temp)
        })
        .catch((err) => {
            alert(err.message);
        });
    })
  
    return (
        <section className={classes.landlord}>
            <div className={classes.container}>
                <Heading title='Our Featured Agents' subtitle='Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.' />

                <div className={`${classes.mtop} ${classes.grid3}`}>
                    {data.map((item, index) => <LandlordCard item={item} index={index}/>)}
                </div>
            </div>
        </section>
    )
}

export default Landlord
